import React, { useState, useEffect } from "react";
import { Formik } from "formik";
import * as Yup from "yup";
import "./styles.css";
import Button from "@mui/material/Button";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import { useNavigate, useLocation } from "react-router-dom";

function AdminConsole() {

    const { state } = useLocation();
    const navigate = useNavigate();
    const [graderMessage, setGraderMessage] = useState("");
    const [graders, setGraders] = useState();

    const theme = createTheme({
        status: {
            danger: "#e53e3e",
        },
        palette: {
            primary: {
                main: "#ff8a00",
            },
            neutral: {
                main: "#ffffff",
                contrastText: "#ff8a00",
            },
        },
    });

    useEffect(() => {
        async function checkUser(value) {
            await fetch('http://127.0.0.1:5000/check_admin', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({
                    email: value.email,
                })
            })
                .then((response) => {
                    return (response.json());
                })
                .then((data) => {
                    if (data.found === false) {
                        navigate('/admin-login');
                    }
                });
        };

        if (state === null) {
            navigate('/admin-login');
        } else {
            checkUser(state);
        }

        async function fetchGraderData() {
            await fetch("http://127.0.0.1:5000/get_graders", {
                method: 'GET',
            })
                .then((response) => {
                    return (response.json());
                })
                .then((data) => {
                    setGraders(data);
                })
                .catch((err) => {
                    console.log(err.message);
                });
        }
        fetchGraderData();
    }, []);

    return (
        <>
            <ThemeProvider theme={theme}>
                <span>
                    <Button
                        style={{ display: "flex" }}
                        variant="contained"
                        color="neutral"
                        onClick={() => { navigate('/') }}
                        className="navHome"
                    >Return Home</Button>

                    <h1 style={{ display: "flex" }}>
                        PlexTech Administrator Console
                    </h1>
                </span>

                {/* Grader Control */}
                <Formik
                    initialValues={{
                        email: "",
                        action1: "",
                    }}
                    onSubmit={async (values) => {
                        if (values.action === "add") {
                            await fetch('http://127.0.0.1:5000/add_grader', {
                                method: 'POST',
                                headers: { 'Content-Type': 'application/json' },
                                body: JSON.stringify({
                                    email: values.email,
                                })
                            }).then(() => {
                                setGraderMessage("Successfully added grader " + values.email + ".")
                            });
                        } else if (values.action === "remove") {
                            await fetch('http://127.0.0.1:5000/remove_grader', {
                                method: 'DELETE',
                                headers: { 'Content-Type': 'application/json' },
                                body: JSON.stringify({
                                    email: values.email,
                                })
                            }).then(() => {
                                setGraderMessage("Successfully removed grader " + values.email + ".")
                            });
                        }
                    }}
                >
                    {formik => (
                        <div className='admin-console'>
                            <span>
                                <Button style={{ "display": "flex" }}
                                    variant="contained"
                                    color="neutral"
                                    onClick={navToHome}
                                    className="navHome">Return Home</Button>

                                <h1 style={{ "display": "flex" }}>PlexTech Application - Spring 2023</h1>

                                <br />
                            </span>

                            <div>

                                <h2>Current Graders:</h2>
                                <p>{graders}</p>

                                <form onSubmit={formik.handleSubmit}>
                                    <label htmlFor="lastName">Grader Email</label>
                                    <input
                                        id="email"
                                        type="text"
                                        {...formik.getFieldProps('email')} />

                                    <label htmlFor="rating1">
                                        What do you want to do with this grader?
                                    </label>

                                    <select className="dropbtn" name="action1" value={action1} onChange={(event) => { setRating1(event.target.value) }}>
                                        <option value="" disabled={true}>Select an action:</option>
                                        <option value={"add"}>add grader</option>
                                        <option value={"remove"}>remove grader</option>
                                    </select>
                                    <p className="copyright">Copyright © 2022 PlexTech All Rights Reserved.</p>
                                </form>
                            </div>
                        </div>
                    )}
                </Formik>
            </ThemeProvider>
        </>
    )
}

export default AdminConsole;
